import React from 'react';
import ReactDOM from 'react-dom';
import ScrollAnim from 'rc-scroll-anim';



const iniciaScroll = () =>{
    ScrollAnim
    .scrollScreen
    .init({loop: false, duration: 1200, ease: "easeInOutQuart", scrollInterval: 800});
}


export default iniciaScroll;
